class CountriesResponse {  late String countrySpanish;  late String countryEnglish;  late String iso2;  late String iso3;  late String code;  CountriesResponse(      this.countrySpanish,       this.countryEnglish,       this.iso2,       this.iso3,       this.code);  CountriesResponse.fromJson(dynamic json) {    countrySpanish = json['CountrySpanish'].toString();    countryEnglish = json['CountryEnglish'].toString();    iso2 = json['Iso2'].toString();    iso3 = json['Iso3'].toString();    code = json['code'].toString();  }  Map<String, dynamic> toJson() {    final map = <String, dynamic>{};    map['CountrySpanish'] = countrySpanish;    map['CountryEnglish'] = countryEnglish;    map['Iso2'] = iso2;    map['Iso3'] = iso3;    map['code'] = code;    return map;  }}